import './Login.css'
import axios from 'axios'
const Login = () => {

const [list, setList]= useState()

useEffect(() =>{
   axios
   .get(`https://api.themoviedb.org/3/movie/top_rated?api_key=977eefe575b9168b5e7fd6e6fabc58f1&language=en-US&page=1`)  
   .then(({data}) => setList(data.results))
   .catch((err) => console.log(err))
},[])

  return (
      <div className="container">
        <div className="grid">
          <img src={`https://image.tmdb.org/t/p/w200 ${list.poster}`} alt="" />
        </div>
        <h1>You are at Login page and trying to use api </h1> 
          </div>
        
  
    
    
  )
}

export default Login
